import React from 'react';
import { Component } from 'react';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = [
      {
        name: "Duong Bao Hung",
        age: "20",
        job: "Developer",
        address: "Ho Chi Minh",
        lover: "Ho My Nghi",
      },
      {
        name: "Ho My Nghi",
        age: "20",
        job: "Lover",
        address: "Ho Chi Minh",
        lover: "Ho My Nghi",
      },
    ];
  }

  setNewData = () => {
